import React from 'react';

const SearchBox = ( {searchChange }, {user} ) => {
	return (
		<div className='debug-grid fl f3 w-40 pa2 pl6' style={{ justifyContent: 'flex-end'}}>
			<div className='pb3'>Hello, {user}</div>
			<input 
				className='pa3 ba b--dark-blue bg-light-yellow'
				type='search'
				placeholder='Search dish'
				onChange={searchChange}
			/>
		</div>
	);
}

export default SearchBox;
